  const context = useContext(BlogContext);
  const {oblog, getBlog} = context;

   let navigate = useNavigate();
   
   useEffect(()=>{
     
    if(localStorage.getItem('token')){
      getBlog();
    }else{
      navigate("/loginAUser");
    }
      // eslint-disable-next-line
   },[]);

