      <>
      <div className='container' style={{margin:'50px'}}>
      <h1>Your Blogs</h1>
      {oblog.length===0 && "No Blogs added yet! Wait no more to inspire the unexpected person! "}
      {oblog.map((blo))}  
    
      </div>
      </>
  )
}

